import { Component } from "@angular/core";

@Component({
  selector: "app-timeline",
  standalone: true,
  imports: [CommonModule],
  templateUrl: "./timeline.component.html",
  styleUrl: "./timeline.component.css",
})
export class TimelineComponent {}
<section id="parcours" class="container mx-auto px-6 py-20">
  <h2 class="text-3xl mb-8">Parcours</h2>
  <ol class="space-y-6">
    <li><strong>2024 —</strong> Freelance Motion &amp; Web</li>
    <li><strong>2021 — 2023</strong> Formation / expériences</li>
    <li><strong>2018 — 2020</strong> Études &amp; stages</li>
  </ol>
</section>
